ESSSE SEMPRE FOI UM PESSSIMO CHEFE DE EMPRESA ...SOINHÃO DEMAIS DETISNO CERTOO PRA ELE VAI VENDER MANDIOCA NA RUA ,, SE NÃO FOR LIGEIROO E SEGURAR O QUE  LHE RESTA DE FORTUNA ..NO MINIMO JA REPASSOU ALGUNS MISERAVEIS REAIS PRA BANCOS LA FORA ,,,É FATOO QUE VAI QUEBARR PIOR  E LEVAR MUITO GENTE COM ELE FORA MAIS 200 TRABALHADORES QUE JA FORAM DEMITIDOS,,
UM MELHIANTE QUE ESTA VENDO TUDOO  ATE O JATINHO E MUITAS OUTRAS COISAS LASTIMAVELL;;

UMM MELHANTE ORDINARIO..UM  MALL PRA SOCIEDADE

tenho 5 ideias:
 1 - prisão perpétua para políticos ladrões;
 2 - salário mínimo para os políticos;
 3 - 44 horas semanais de trabalho;
 4 - Proibição de contratação de parentes, amigos, conchavos, baba ovo, parceiro, truta, mulher, sogra, ex-sogra, ex-mulher, chegado, mano, conhecido, filho da vizinha entre outros no serviço público sem concurso;
 5 - aposentadoria depois de 35 anos de serviços políticos prestados.

Deveria incluir uma outra série de sugestões, como :
1 - a escolha de ministros de tribunais superiores e de juízes de tribunais regionais diretamente por esses respectivos órgãos, sem chancela  do Executivo;
2 - fim das promoções de magistrados por merecimento, mantendo-as apenas por antiguidade;
3 - fim do acesso aos tribunais pelo quinto constitucional, sendo a magistratura exercida apenas por juízes concursados e que cumpriram os tempos de substituto e titular na primeira instância.
Tudo isso seria maravilhoso para eliminar a possibilidade de interferência política no Judiciário. Mas a OAB não quer que isso seja modificado, o que é lamentável. O Poder Judiciário deve ser exercido puramente por magistrados concursados, sem qualquer possibilidade de ingerência de politicagens.

Fim do foro privilegiado para qualquer cargo público;
Fim do voto obrigatório;
Fim do voto secreto no parlamento;
Estabelecimento do voto distrital;
Redução do número de deputados federais e senadores;
Fim da reeleição / impedimento de eleições sucessivas para o mesmo cargo;
Não à lista fechada de candidatos por partido;
Não ao financiamento público exclusivo de campanha;
Fim da aposentadoria integral após oito anos de mandato;
Fim à suplência e coligações partidárias;
E como última sugestão, a mudança do Congresso Nacional de Brasília para uma cidade mais representativa como São Paulo ou Rio. Afinal, o povo precisa ficar mais próximo de seus parlamentares!
